eds can also be <a href=\"@import-opml\">imported via an OPML file</a>.','','none'),(3342,'','default','Configuring cron','','none'),(3343,'','default','A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(3344,'','default','<acronym title=\"Outline Processor Markup Language\">OPML</acronym> is an XML format used to exchange multiple feeds between aggregators. A single OPML document may contain a collection of many feeds. Drupal can parse such a file and import all feeds at once, saving you the effort of adding them manually. You may either upload a local file from your computer or enter a URL where Drupal can download it.','','none'),(3345,'','default','Administer news feeds','','none'),(3346,'','default','View news feeds','','none'),(3347,'','default','Configure the behavior of the feed aggregator, including when to discard feed items and how to present feed items and categories.','','none'),(3348,'','default','Override the default title for the block. Use <em>!placeholder</em> to display no title, or leave blank to use the default block title.','','none'),(3349,'','default','Specify in which themes and regions this block is displayed.','','none'),(3350,'','default','All pages except those listed','','none'),(3351,'','default','Only the listed pages','','none'),(3352,'','default','Specify pages by using their paths. Enter one path per line. The \'*\' character is a wildcard. Example paths are %blog for the blog page and %blog-wildcard for every personal blog. %front is the front page.','','none'),(3353,'','default','Pages on which this PHP code returns <code>TRUE</code> (experts only)','','none'),(3354,'','default','Pages or PHP code','','none'),(3355,'','default','If the PHP option is chosen, enter PHP code between %php. Note that executing incorrect PHP code can break your Drupal site.','','none'),(3356,'','default','Customizable per user','','none'),(3357,'; modules/block/block.js','default',