ow you to track differences between multiple versions of your content, and revert back to older versions.','','none'),(3795,'','default','The content on this page has either been modified by another user, or you have already submitted modifications using this form. As a result, your changes cannot be saved.','','none'),(3796,'','default','Administer content types','','none'),(3797,'','default','Warning: Give to trusted roles only; this permission has security implications.','','none'),(3798,'','default','View published content','','none'),(3799,'','default','Access the content overview page','','none'),(3800,'','default','Bypass content access control','','none'),(3801,'','default','View content revisions','','none'),(3802,'','default','Revert content revisions','','none'),(3803,'','default','Delete content revisions','','none'),(3804,'','default','View own unpublished content','','none'),(3805,'','default','Content is sticky at top of lists','','none'),(3806,'','default','Content is promoted to the front page','','none'),(3807,'','default','Recent content','','7.52'),(3808,'','default','Number of recent content items to display','','none'),(3809,'','default','Show block for specific content types','','none'),(3810,'','default','Unpublish content','','7.52'),(3811,'','default','Make content sticky','','7.52'),(3812,'','default','Make content unsticky','','7.52'),(3813,'','default','Promote content to front page','','7.52'),(3814,'','default','Remove content from front page','','7.52'),(3815,'','default','Change the author of content','','7.52'),(3816,'','default','Save content','','7.52'),(3817,'','default','Unpublish content containing keyword(s)','','7.52'),(3818,'','default','The content will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(3819,'','default','One permission in use','','none'),(3820,'','default','@count permissions in use','