gged into record the user\'s OpenID password.','','none'),(3832,'','default','Once you have verified your e-mail address, you may log in via OpenID.','','none'),(3833,'','default','Sorry, that is not a valid OpenID. Ensure you have spelled your ID correctly.','','none'),(3834,'','default','Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(3835,'','default','@title dialog','','none'),(3836,'','default','An alias defines a different name for an existing URL path - for example, the alias \'about\' for the URL path \'node/1\'. A URL path can have multiple aliases.','','none'),(3837,'','default','Administer URL aliases','','none'),(3838,'','default','Create and edit URL aliases','','none'),(3839,'','default','The alias is already in use.','','none'),(3840,'','default','Enabling execution of PHP in text fields','','none'),(3841,'','default','Use PHP for settings','','none'),(3842,'','default','The PHP module has been disabled. Any existing content that was using the PHP filter will now be visible in plain text. This might pose a security risk by exposing sensitive information, if any, used in the PHP code.','','none'),(3843,'','default','The Poll module can be used to create simple surveys or questionnaires that display cumulative results. A poll is a good way to receive feedback from site users and community members. For more information, see the online handbook entry for the <a href=\"@poll\">Poll module</a>.','','none'),(3844,'','default','Creating a poll','','none'),(3845,'','default','Users can create a poll by clicking on Poll on the <a href=\"@add-content\">Add new content</a> page, and entering the question being posed, the answer choices, and beginning vote counts for each choice. The status (closed or active) and duration (length of time the poll remains active for new votes) can also be specified.','','none'),(3846,'','default','Viewing polls','','none'),(3847,'','default','You can visit the <a href=\"@poll\">Polls</a> page to view all current polls, or alternately enable the <em>Most recent poll</em> block on the <a href=\"@blocks\">Blocks administration page</a>. To vote in or view the results of a specific poll, you can click on the poll itself.','','none'),(3848,'','default','Vote on polls','','none'),(3849,'','default','Cancel and change own votes','','none'),(3850,'','default','Your vote was cancelled.','','none'),(3851,'','default','To enable browsing this field by value, enter a title for the resulting page. The word <code>%value</code> will be substituted with the corresponding value. An example page title is \"People whose favorite color is %value\" . This is only applicable for a public field.','','none'),(3852,'','default','To enable browsing this field by value, enter a title for the resulting page. An example page title is \"People who are employed\" . This is only applicable for a public field.','','none'),(3853,'','default','The Profile module allows site administrators to define custom fields (such as country, full name, or age) for user profiles, which are then displayed in the <a href=\"@user\">My Account</a> section. This permits users of a site to share more information about themselves, and can help community-based sites organize users around specific information. For more information, see the online handbook entry for <a href=\"@profile\">Profile module</a>.','','none'),(3854,'','default','Adding fields to the default profile','','none'),(3855,'','default','To provide the ability for users to enter more information about themselves, the Profile module allows additional fields to be added to the default user profile. Examples of common additions would be <em>Location</em>, <em>Company</em>, <em>Age</em>, or <em>About me</em>.','','none'),(3856,'','default','User information pages','','none'),(3857,'','default','The Profile module enables links to see further information about site users. You can view both a main <a href=\"@profile\">User list page</a>, and more specified pages by clicking on linked fields in any profile. For example, the <a href=\"@profile-country\">People who live in Canada</a> listing on Drupal.org displays all users who have entered <em>Canada</em> in the <em>Country</em> field on their user profile.','','none'),(3858,'','default','Author information block','','none'),(3859,'','default','This page displays a list of the existing custom profile fields to be displayed on a user\'s <em>My account</em> page. To provide structure, similar or related fields may be placed inside a category. To add a new category (or edit an existing one), edit a profile field and provide a new category name.','','none'),(3860,'','default','The active search modules have been changed.','','none'),(3861,'','default','Searched %type for %keys.','','none'),(3862,'','default','<ul>\n<li>Check if your spelling is correct.</li>\n<li>Remove quotes around phrases to search for each word individually. <em>bike shed</em> will often show more results than <em>&quot;bike shed&quot;</em>.</li>\n<li>Consider loosening your query with <em>OR</em>. <em>bike OR shed</em> will often show more results than <em>bike shed</em>.</li>\n</ul>','','none'),(3863,'','default','Administer search','','none'),(3864,'','default','Use search','','none'),(3865,'','default','Use advanced search','','none'),(3866,'','default','Choose a set of shortcuts to use','','none'),(3867,'','default','Choose a set of shortcuts for this user','','none'),(3868,'','default','You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\"@switch-url\">switch back to a different one.</a>','','none'),(3869,'','default','%user is now using a new shortcut set called %set_name. You can edit it from this page.','','none'),(3870,'','default','You are now using the %set_name shortcut set.','','none'),(3871,'','default','%user is now using the %set_name shortc