كوين الثيمة المبدئية لموقعك. <a href=\"@themes\">ثيمات</a> أخرى متاحة.','ar',0,0,0),(382,'تحديد الحلة الافتراضية','ar',0,0,0),(383,'مخفي','ar',0,0,0),(388,'%theme هي الآن theme الافتراضية.','ar',0,0,0),(390,'تم حفظ خيارات الضبط.','ar',0,0,0),(391,'بحث','ar',0,0,0),(392,'أدخل العبارات التي تريد البحث عنها.','ar',0,0,0),(393,'نصائح للكتابة','ar',0,0,0),(394,'يستخدم <a href=\"@poweredby\">دروبال</a>','ar',0,0,0),(396,'@module (<span class=\"admin-enabled\">مُفَعَّل</span>)','ar',0,0,0),(400,'ضبط الصلاحيات','ar',0,0,0),(401,'ضبط','ar',0,0,0),(402,'@module (<span class=\"admin-disabled\">معطل</span>)','ar',0,0,0),(405,'تجمع المحتوى المتزامن (تلقيمات RSS وRDF وAtom).','ar',0,0,0),(406,'حول','ar',0,0,0),(407,'وحدة Block تسمح لك بإنشاء صناديق من المحتوى معروضة في مناطق من صفحة أو عدة صفحات من موقعك. على سبيل المثال، حلة الإدارة Seven، المدمجة مع دروبال، توفر مناطق: \"المحتوى\" و\"المساعدة\" و\"لوحة الجدول الرئيسي\" و\"حافة الشريط الجانبي\"، ويمكن لأي صندوق أن يظهر في أي من هذه المناطق. توفر <a href=\"@block\">صفحة إدارة الصناديق</a> واجهة سحب وإفلات لإسناد صندوق إلى منطقة، وللتحكم في ترتيب الصناديق في منطقة ما. لمزيد من المعلومات يرجى مراجعة دليل <a href=\"@block\">وحدة الصندوق</a>  على الشبكة.','ar',0,0,0),(408,'الاستخدامات','ar',0,0,0),(409,'تموضع المحتوى','ar',0,0,0),(410,'أثناء العمل مع الصناديق، تذكر أنه <em>ليست كل</em> الثيمات توفر نفس المناطق، أو تعرض المناطق بنفس الطريقة. يتم وضع الصناديق حسب بنية كل ثيمة. بإمكان المستخدمين ذوي صلاحية <em>إدارة الصناديق</em> تعطيل الصناديق. الصناديق المعطلة مدرجة في <a href=\"@blocks\">صفحة إدارة الصناديق</a>، ولكن لا يتم عرضها في أي منطقة.','ar',0,0,0),(411,'التحكم بالظهور','ar',0,0,0),(412,'يمكن ضبط الصناديق لتكون مرئية على بعض الصفحات فقط لبعض المستخدمين ذوي صلاحيات معينة، أو بعض الصفحات التي تعرض بعضاً من <a href=\"@content-type\">أنواع المحتوى</a>. أيضاً بإمكان الإداريين تمكين المستخدمين من إظهار أو إخفاء صناديق محددة أثناء تحريرهم لصفحة <a href=\"@user\">الملف الشخصي</a> الخاصة بهم. يتم عرض بعض الصناديق الحيوية، كتلك المنشأة عن طريق الوحدات، على صفحات معينة فقط.','ar',0,0,0),(413,'إنشاء صناديق مخصصة','ar',0,0,0),(414,'بإمكان المستخدمين ذوي صلاحية <em>إدارة الصناديق</em> <a href=\"@block-add\">إضافة صناديق مخصصة</a>، والتي سيتم إدراجها بعد ذلك على <a href=\"@blocks\">صفحة إدارة الصناديق</a>. بعد إنشائها، تتصرف هذه الصناديق كالصناديق المبدئية والصناديق المولدة من طرف الوحدات.','ar',0,0,0),(415,'التحكم في البناء الشكلي للصناديق من خلال الصفحة التي انشئ من خلالها. الصناديق هي أطر يتم عرض محتوي بها بالعرض في منطقه او نطاق ما من صفحة الويب.','ar',0,0,0),(416,'تفعل المدونات المتعددة المستخدمين.','ar',0,0,0),(417,'تسمح للمستخدمين بإنشاء وتنظيم المحتوى المرتبط ضمن هيكل.','ar',0,0,0),(418,'تسمح وحدة الألوان للمستخدمين ذوي صلاحية <em>إدارة إعدادت الموقع</em> بتغيير خطة ألوان الثيمة المتوافقة معها بسهولة وسرعة. لمزيد من المعلومات راجع كتيب <a href=\"@color\">وحدة الألوان</em> بموقع دروبال.','ar',0,0,0),(419,'تغيير الألوان','ar',0,0,0),(420,'باستخدام الوحدة Color يمكنك أن تغير بسهولة لون الروابط والخلفيات والنصوص وعناصر الحلة الأخرى. لتغيير إعدادت الألوان لحلة متوافقة، اختر رابط <em>الإعدادات</em> للحلة في <a href=\'@configure\'>صفحة إدارة الحلل</a>. إذا لم ترى منتقي الألوان على هذه الصفحة، فهذا يعني أن حلتك غير متوافقة مع الوحدة Color. إذا كنت متأكدا أن الحلة متوافقة مع الوحدة Color، ورغم ذلك لا يظهر منتقي الألوان، فعليك <a href=\'@troubleshoot\'>اتباع خطوات اكتشاف الخلل هذه</a>.','ar',0,0,0),(421,'تحفظ الوحدة Color نسخة معدلة لملفات شكل الحلة المعينة في مجلد الملفات. هذا يعني أنك إذا قمت بأي تغييرات يدوية على شكل حلتك، <em>فيجب عليك إعادة تسجيل إعداداتك للألوان، حتى ولو لم تتغير</em>. هذه الخطوة ضرورية لأن أشكلب الوحدة (في مجلد الملفات) تحتاج إلى إعادة الإنشاء لاحتواء تغييراتك.','ar',0,0,0),(422,'تسمح للإداريين بتعديل مخطط الألوان للثيمات المتوافقة.','ar',0,0,0),(423,'تسمح الوحدة Comment للمستخدمين بالتعليق على محتوى الموقع وتعيين إعدادات وصلاحيات التعليق الافتراضية ومراجعة التعليقات. للمزيد من المعلومات، راجع صفحة الدليل على الشبكة الخاصة <a href=\"@comment\">بالوحدة Comment</a>.','ar',0,0,0),(424,'الإعدادت الإفتراضية والمخصصة','ar',0,0,0),(425,'يمكن لكل <a href=\'@content-type\'>نوع محتوى</a> أن يحصل على إعدادات تعليق افتراضية خاصة به يتم ضبطها على الشكل: <em>مفتوح</em> للسماح بالتعليقات الجديدة، <em>مخفي</em> لإخفاء التعليقات الموجودة ومنع التعليقات الجديدة، أو <em>مغلق</em> لعرض التعليقات الموجودة، ومنع التعليقات الجديدة. سيتم تطبيق هذه الإعدادت الافتراضية على كل المحتويات الجديدة (تغيير إعدادات المحتويات الموجودة مسبقاً سيكون يدوياً). يمكن أيضاً تعديل إعدادت التعليق الأخرى بحسب كل نوع محتوى، ويمكن لكل محتوى أن يعدل إعداداته بشكل مستقل. ويبقى التعليق قابل للتعديل من طرف مؤلفه مادام لم يتم الرد عليه، إذا كان صاحب التعليق مسجل الدخول على الموقع.','ar',0,0,0),(426,'الموافقة على التعليق','ar',0,0,0),(427,'يتم نشر تعليقات المستخدمين ذوي صلاحية <em>تجاهل الموافقة على التعليق</em> مباشرة. يتم وضع باقي التعليقات الأخرى في طابور <a href=\'@comment-approval\'>التعليقات غير الموافق عليها بعد</a>، حتى يقوم مستخدم ذو صلاحية <em>إدارة التعليقات</em> بنشرها أو حذفها. بالإمكان التحكم في التعليقات المنشورة في صفحة إدارة <a href=\'@admin-comment\'>التعليقات المنشورة</a>.','ar',0,0,0),(428,'تسمح للمستخدمين بالتعليق على المحتوى المنشور و مناقشته.','ar',0,0,0),(429,'تفعل استعمال كلي استماراتي الاتصال الشخصية والشاملة للموقع.','ar',0,0,0),(430,'تسمح بترجمة المحتوى إلى لغات مختلفة.','ar',0,0,0),(432,'عرض الروابط السياقية','ar',0,0,0),(433,'يتم توفير الروابط القياسية من طرف الوحدات لمنحك وصول سريع إلى المهام المرتبطة بمناطق من الصفحات بموقعك. مثلاً إذا كان لديك صندوق لقائمة مخصصة معروض على الشريط الجانبي لموقعك، فإن وحدات <em>القوائم</em> و <em>الصناديق</em> ستقوم بإضافة روابط لضبط الصندوق وتغيير القائمة. تقوم وحدة <em>الروابط القياسية</em> بجمع هذه الروابط بقائمة ليتم عرضها من طرف القالب. كما تقوم أيضاً هذه الروابط بإضافة كود جافاسكربت لإخفاء هذه الروابط مبدئياً ثم عرضها عند تمرير مؤشر الفأرة عليها.','ar',0,0,0),(434,'توفر روابط سياقية لتفيذ إجراءات مرتبطة بعناصر في الصفحة.','ar',0,0,0),(435,'توفر وحدة لوحة التحكم <a href=\"@dashboard\">صفحة تحكم</a> في واجهة الإدارة لتنظيم المهام الإدارية، والتنقل وبيانات المتابعة بموقعك. تحتوي لوحة التحكم على صناديق يمكنك إضافتها وإعادة ترتيبها باستخدام واجهة السحب واﻹفلات التي تظهر عند النقر على رابط <em>تعديل لوحة التحكم</em>. في هذه الواجهة، الصناديق الغير مستخدمة لا تظهر بشكل افتراضي، لكن يمكن إضافتها برابط <em>إضافة صندوق آخر</em>. للمزيد من المعلومات، يرجى مراجعة <a href=\"@handbook\">وحدة لوحة التحكم</a> بموقع دروبال.','ar',0,0,0),(436,'تتبع نشاط المستخدم','ar',0,0,0),(437,'بتمكين بلوكات مثل <em>المتصلون الآن</em> و <em>المستخدمون الجدد</em>، فإنك تسمح لمستخدمي الموقع بمتابعة المستخدمين الجدد والمتصلين الآن في نفس المكان.','ar',0,0,0),(438,'تتبع نشاط المحتوى','ar',0,0,0),(439,'بتفعيل صناديق مثل <em> أحدث الرسائل في المدونة </em>,<em>مواضيع جديدة في المنتدى</em> و <em>آخر التعليقات</em>, مستخدموا الموقع سيتمكنون بسرعة من مشاهدة المحتويات المضافة جديداً في الموقع.','ar',0,0,0),(440,'توفر صفحة لوحة تحكم في واجهة الإدارة لتنظيم العمليات ومتابعة المعلومات الخاصة بموقعك.','ar',0,0,0),(441,'تقوم وحدة سجل قاعدة البيانات بتخزين جميع أحداث النظام في قاعدة البيانات. للمزيد من المعلومات، يرجى مراجعة صفحة <a href=\"@dblog\">وحدة سجل قاعدة البيانات</a> على موقع دروبال.','ar',0,0,0),(442,'مراقبة موقعك','ar',0,0,0),(443,'يسمح لك سجل قاعدة البيانات بمشاهدة تسجيل حدث على صفحة <a href=\"@dblog\">آخر رسائل السجل</a>. السجل هو قائمة بالتسلسل الزمني للأحداث المسجلة يحتوي على البيانات المستخدمة، بيانات الأداء، الأخطاء، التحذيرات والمعلومات التنفيذية. يجب على الإداريين التحقق من السجل بصفة منتظمة للتأكد من عمل الموقع بشكل الصحيح.','ar',0,0,0),(444,'تصحيح مشاكل الموقع','ar',0,0,0),(445,'في حال حدوث مشاكل أو أخطاء بالموقع، فإن صفحة <a href=\"@dblog\">آخر رسائل السجل</a> قد تكون مفيدة لتتبع الأخطاء، حيث أنها تعرض تسلسل الأحداث. يتضمن سجل الأحداث معلومات حول الاستخدام، تحذيرات وأخطاء الموقع.','ar',0,0,0),(446,'تسجل أحداث النظام في قاعدة البيانات.','ar',0,0,0),(447,'تسمح وحدة Field بتعديل بيانات الحقول لتعريفها إلى أنواع <em>الكيانات</em> (تشمل الكيانات عناصر المحتوى والتعليقات وحسابات المستخدمين ومفردات التصنيفات). تتولى وحدة Field تخزين وتحميل وتعديل وترتيب بيانات الحقول. معظم المستخدمين لا يتعاملون مع وحدة Field مباشرة، لكن يستخدمون بدلاً عن ذلك وحدة <a href=\"@field-ui-help\">Field UI</a>. بإمكان مطوري الوحدات استخدام تطبيق Field API لإنشاء أنواع جديدة من الكيانات مما يسمح بربطها بالحقول. للمزيد من المعلومات يرجى مراجعة دليل <a href=\"@field\">وحدة Field</a> على الشبكة.','ar',0,0,0),(448,'تفعيل أنواع الحقول','ar',0,0,0),(449,'توفر وحدة الحقل البنية الأساسية للحقول ولواحقها، أنواع الحقول وواجهات الإدخال توفر من وحدات إضافية. بعض الوحدات ضرورية، ويتم تفعيل الوحدات الاختيارية من <a href=\"@modules\">صفحة إدارة الوحدات</a>. يتضمن دروبال أنواع الحقول التالية: العدد (ضروري)، النص (ضروري)، القائمة (ضروري)، التصنيف (اختياري)، الصورة (اختياري) والملف (اختياري)، وحدة الخيارات (ضروري) توفر واجهات إدخال وحدات الحقول الأخرى. يمكن توفير حقول وواجهات إضافية من طرف وحدات إضافية يمكنك إيجادها في <a href=\"@contrib\">صفحة الوحدات الإضافية لدروبال</a>. وحدات الحقول والواجهات المفعلة حالياً هي:','ar',0,0,0),(450,'إدارة تخزين بيانات الحقل','ar',0,0,0),(451,'بإمكان مطوري وحدات الحقول استخدام <a href=\"@sql-store\">وحدة تخزين حقل SQL</a> الافتراضي لتخزين بيانات حقولهم، أو استخدام وحدة إضافية، أو وحدة معدلة ومطورة باستخدام <a href=\"@storag-api\">تخزين حقل API</a>.','ar',0,0,0),(452,'يستعمل تطبيق Field API لإضافة حقول للكيانات مثل العقد والمستخدمين.','ar',0,0,0),(453,'تقوم وحدة حقل تخزين SQL بتخزين بيانات الحقول بقاعدة البيانات. وهي وحدة تخزين الحقل الافتراضية. يمكن توفر آليات تخزين حقول أخرى على شكل وحدات إضافية. للمزيد من المعلومات حول الحقول، يرجى مراجعة <a href=\"@field-help\">الحقل</a> على موقع دروبال.','ar',0,0,0),(454,'يخزن بيانات الحقل في قاعدة بيانات SQL.','ar',0,0,0),(456,'تخطيط الحقول','ar',0,0,0),(457,'هناك العديد من القرارات التي عليك اتخاذها قبل تعريف حقل للمحتوى أو تعليقات، الخ:','ar',0,0,0),(458,'اسم الحقل','ar',0,0,0),(459,'يملك الحقل <em>عنوانا</em> (الاسم المعروض في واجهة المستخدم) و <em>اسما آليا</em> (الاسم المستخدم داخليا). يمكن تغيير العنوان بعد إنشاء الحقل، إذا لزم الأمر، ولكن لا يمكن تغيير الاسم الآلي بعد إنشاء الحقل.','ar',0,0,0),(460,'نوع البيانات التي يخزنها الحقل.','ar',0,0,0),(461,'يمكن لكل حقل تخزين نوع واحد من البيانات (نص، عدد، ملف، إلخ). عند تعريف الحقل، تختار <em>نوع حقل</em> محدد، يتوافق مع نوع البيانات المراد تخزينها. لا يمكن تغيير نوع الحقل بعد إنشائه.','ar',0,0,0),(462,'طريقة إدخال وعرض البيانات','ar',0,0,0),(463,'كل نوع حقل لديه <em>widgets</em> واحدة أو أكثر مرتبطة به، كل widget تقدم طريقة لإدخال البيانات عند التحرير (مربع نص، قائمة اختيار، رفع ملف، إلخ...). أيضاً كل نوع حقل لديه عدة خيارات للعرض، والتي ستحدد كيف سيظهر هذا الحقل لزوار الموقع. يمكنك أيضاً تغيير ال widget وخيارات العرض بعد إنشاء الحقل.','ar',0,0,0),(464,'عدد القيم التي يخزنها الحقل','ar',0,0,0),(465,'يمكنك تخزين قيمة واحدة، عدد معين من القيم أو عدد غير محدود من القيم لكل حقل. مثلاً، بإمكان حقل معرف الموظف أن يحتوي على رقم واحد بينما حقل رقم الهاتف يمكن أن يحوي عدة أرقام. يمكن تغيير هذا الخيار بعد إنشاء الحقل، ولكن إذا قمت بتحديد حد أقصى للقيم فقد تفقد المعلومات.','ar',0,0,0),(466,'إعادة استخدام الحقول','ar',0,0,0),(467,'عندما تقوم بتعريف حقل ما، يمكنك إعادة استخدامه. مثلا، إذا قمت بتعيين حقل صورة مخصص لنوع من المحتوى، وأردت حقلا آخر للصورة بنفس الإعدادات في نوع آخر من المحتوى، فيمكنك إضافة نفس الحقل إلى النوع الثاني من المحتوى، في جزء <em>إضافة حقل موجود</em> من واجهة المستخدم. بإمكانك أيضا إضافة هذا الحقل إلى مفرد مصطلحات، التعليقات، حسابات المستخدم، إلخ.','ar',0,0,0),(468,'بعض إعدادات الحقل المعاد استخدامه محددة لكل استخدام للحقل، وأخرى مشتركة بين النسخ التي تستخدم هذا الحقل. مثلاً، تسمية حقل النص تختلف حسب الاستخدام بينما إعدادات عدد القيم متشابهة.','ar',0,0,0),(470,'حقول على المحتويات','ar',0,0,0),(472,'حقول على الوسوم','ar',0,0,0),(473,'يتم تعيين حقول مفردات المصطلحات على مستوى التصنيفات، في علامة التبيوب <em>إدارة الحقول</em> في صفحة تعديل المفردات (والتي يمكنك الوصول إليها في صفحة <a href=\"@taxonomy\">التصنيفات</a>). عندما تقوم بتعيين حقل للمفردات، فإن كل مصطلح من المفردات سيمتلك هذا الحقل. يمكنك على سبيل المثال تعيين حقل صورة للمفردات لتخزين أيقونة لكل مصطلح.','ar',0,0,0),(474,'حقول على حسابات المستخدمين','ar',0,0,0),(475,'يتم تعيين حقول حسابات المستخدمين للموقع بأكمله في علامة التبويب <a href=\"@fields\">إدارة الحقول</a> في صفحة <a href=\"@accounts\">إعدادات المستخدم</a>. عندما تقوم بتعيين حقل لحساب المستخدم، فسيكون لكل حساب مستخدم هذا الحقل. يمكنك على سبيل المثال إضافة حقل نصي للسماح للمستخدمين بإضافة سيرتهم الذاتية.','ar',0,0,0),(476,'حقول على التعليقات','ar',0,0,0),(477,'يتم تعيين حقول التعليقات على مستوى أنواع المحتوى، في علامة التبيوب <em>حقول التعليقات</em> في صفحة تعديل أنواع المحتوى (والتي يمكنك الوصول إليها في صفحة <a href=\"@types\">أنواع المحتوى</a>). عندما تقوم بتعيين حقل للتعليقات، فإن كل تعليق من هذا النوع من المحتوى سيمتلك هذا الحقل. يمكنك على سبيل المثال تعيين حقل رابط للتعليقات على المنتديات للسماح للمستخدمين بإضافة موقعهم.','ar',0,0,0),(478,'واجهة المستخدم لتطبيق Field API.','ar',0,0,0),(480,'إرفاق ملفات إلى المحتوى','ar',0,0,0),(481,'تسمح وحدة الملفات للمستخدمين بإرفاق ملفات مع المحتوى (مثلاً، ملف PDF، ملف إكسل، إلخ)، عند إضافة حقل <em>ملف</em> إلى نوع من المحتوى عن طريق <a href=\"@fieldui-help\"><em>وحدة واجهة الحقل</em></a>. بإمكانك إضافة خيارات التحقق إلى حقل الملف، كتحديد حد أقصى لحجم الملف واللواحق المسموح بها.','ar',0,0,0),(482,'إدارة عرض الملفات المرفقة','ar',0,0,0),(484,'إدارة أماكن الملفات','ar',0,0,0),(486,'يعرّف نوع الحقل ملف.','ar',0,0,0),(488,'إعداد تنسيقات النص','ar',0,0,0),(490,'تطبيق المرشحات على النص','ar',0,0,0),(492,'تعريف تنسيقات النص','ar',0,0,0),(494,'اختيار تنسيق نص','ar',0,0,0),(496,'يرشح المحتوى لتحضيره للعرض.','ar',0,0,0),(497,'توفر منتديات مناقشة.','ar',0,0,0),(498,'توفر وحدة المساعدة <a href=\"@help-page\">صفحات دعم</a> ونصائح لإرشادك في تكوين ثم استخدام الوحدات. هي نقطة البدء <a href=\"@handbook\">لدليل دروبال على الإنترنت</a>. هذا الدليل يحتوي على معلومات أكثر إثراء، ومحدثة دوماً بمشاركات المستخدمين. الدليل على الإنترنت هو المرجع النهائي للوثائق. للمزيد من المعلومات، يرجى مراجعة دليل دروبال على الإنترنت لوحدة <a href=\"@help\">المساعدة</a>.','ar',0,0,0),(499,'تقديم المساعدة المرجعية','ar',0,0,0),(500,'تعرض وحدة المساعدة تعليمات استخدام لكل وحدة مذكورة على <a href=\"@help\">الصفحة الرئيسية للمساعدة</a>.','ar',0,0,0),(501,'تقديم المساعدة السياقية','ar',0,0,0),(502,'تعرض وحدة المساعدة نصائح وتعليمات على مختلف الصفحات حسب الحاجة.','ar',0,0,0),(503,'تسير عرض المساعدة المباشرة.','ar',0,0,0),(505,'تعديل الصور','ar',0,0,0),(507,'استناداً إلى المكان الذي ستستخدم فيه: على سبيل المثال <em>profile-picture</em>','ar',0,0,0),(508,'وصف مظهرها : مثلا <em>مربع-85×85</em>','ar',0,0,0),(510,'إرفاق الصور إلى المحتوى كحقول','ar',0,0,0),(512,'توفر أدوات لمعالجة الصور.','ar',0,0,0),(513,'توفر وحدة القائمة حقول متنوعة تسمح بتخزين قائمة من العناصر، لاستخدامها مع وحدة <em>الحقل</em>. عادة، يتم إدخال هذه العناصر عن طريق قائمة من خانات الاختيار أو أزرار التحديد. للمزيد من المعلومات حول هذه الحقول، يرجى مراجعة صفحة <a href=\"@field-help\">الحقل</a> على موقع دروبال.','ar',0,0,0),(514,'تعريف أنواع حقول قائمة. تستخدم مع خيارات لإنشاء قائمة إختيارات.','ar',0,0,0),(515,'تسمح وحدة الترجمة بعرض موقعك بلغات أخرى غير الإنجليزية الافتراضية، وليكون الموقع أيضاً متعدد اللغات. تعمل وحدة الترجمة عن طريق الحفاظ على قاعدة بيانات للترجمات، وتحليل النص المراد عرضه. عند توفر ترجمة للنص باللغة المراد عرضها، يتم استخدام الترجمة بدلاً من النص الأصلي. وعند عدم توفر الترجمة، يتم عرض النص الأصلي، ثم يتم حفظ النص الأصلي في حال عدم وجود ترجمة لتتم مراجعته من طرف مترجم. للمزيد من المعلومات، يرجى مراجعة دليل <a href=\"@locale\">وحدة الترجمة</a> على الإنترنت.','ar',0,0,0),(516,'ترجمة نص الواجهة','ar',0,0,0),(517,'يمكن توفير ترجمات نصوص واجهة دروبال بواسطة:','ar',0,0,0),(518,'الترجمة من موقعك باستخدام <a href=\'@translate\'>واجهة الترجمة</a> المتكاملة مع وحدة المحلية.','ar',0,0,0),(521,'ضبط موقع متعدد اللغات','ar',0,0,0),(523,'تضيف خصائص التعامل مع اللغات وتمكن المستخدم من تغيير لغة واجهة الاستخدام إلى لغات غير الإنجليزية.','ar',0,0,0),(524,'وحدة القائمة تحوي واجهة لإدارة القوائم. القائمة هي مجموعة من الروابط بشكل هرمي (أب وأولاد) تؤدي لصفحات داخل أو خارج الموقع، تستخدم عادة للتصفح. كل قائمة لها صندوق خاص بها يمكن تفعيله وتغيير مكانه من <a href=\"@blocks\">صفحة إدارة الصناديق</a>. يمكنك استعراض وإدارة القوائم من <a href=\"@menus\">صفحة إدارة القوائم</a>. للمزيد من المعلومات راجع صفحة الدليل الإلكتروني حول <a href=\"@menu\">وحدة القائمة</a>.','ar',0,0,0),(525,'إدارة القوائم','ar',0,0,0),(527,'عرض القوائم','ar',0,0,0),(528,'بعد قيامك بإنشاء قائمة، يجب عليك تفعيل واختيار موضع الصندوق المرتبط بها عن طريق صفحة <a href=\"@blocks\">إدارة الصناديق</a>.','ar',0,0,0),(529,'تسمح للإداريين بتطويع قائمة تصفح الموقع.','ar',0,0,0),(531,'تقوم وحدة العقدة بالتحكم في إنشاء، تعديل، حذف، إعداد وعرض المحتوى الرئيسي للموقع. عناصر المحتوى (<strong>العقد</strong>) التي تديرها وحدة العقد يتم عرضها عادة كصفحات بالموقع الخاص بك، وتتضمن عنوان، عدد معين من البيانات (المؤلف، تاريخ الإنشاء، نوع المحتوى، ... إلخ) وبعض الحقول الاختيارية التي يمكن أن تحتوي نصوص أو أنواع أخرى من البيانات (يتم التحكم في الحقول من طرف <a href=\"@field\">وحدة الحقول</a>). للمزيد من المعلومات، يرجى مراجعة دليل <a href=\"@node\">وحدة العقد</a> على الإنترنت.','ar',0,0,0),(532,'إنشاء محتوى','ar',0,0,0),(533,'عندما يتم إنشاء محتوى جديد، تقوم وحدة العقده بتخزين المعلومات الأساسية ذات الصلة بهذا المحتوى وهي تشمل المؤلف، تاريخ الإنشاء، و <a href=\"@content-type\">نوع المحتوى</a>.كما يتم أيضا التحكم في <em>خيارات النشر</em>، فهي تسمح بتحديد ما إذا كان سيتم نشر المحتوى أم لا، ترقيته إلى الصفحة الرئيسية، و/أو تثبيته في أعلى قائمة المحتويات. يمكن ضبط الإعدادات الافتراضية لكل <a href=\"@content-type\">نوع محتوى</a> على موقعك.','ar',0,0,0),(534,'إنشاء أنواع محتوى مخصصة','ar',0,0,0),(536,'إدارة المحتوى','ar',0,0,0),(537,'تسمح لك صفحة <a href=\"@content\">إدارة المحتوى</a> بمتابعة وإدارة المحتوى على موقعك.','ar',0,0,0),(538,'إنشاء المراجعات','ar',0,0,0),(539,'تتيح أيضاً وحدة العقد إنشاء عدة نسخ من أي محتوى، واستعادة النسخ السابقة باستخدام إعدادات <em>معلومات المراجعة</em>.','ar',0,0,0),(540,'صلاحيات المستخدم','ar',0,0,0),(541,'تقدم وحدة العقد عدد معين من الصلاحيات المتوفرة لكل نوع من المحتوى، يمكن ضبطها لكل دور في صفحة <a href=\"@permissions\">الصلاحيات</a>.','ar',0,0,0),(542,'تسمح بنشر المحتوى على الموقع و عرضه في صفحات.','ar',0,0,0),(544,'تعين أنواع الحقول الرقمية','ar',0,0,0),(545,'يمكن دخول المستخدمين إلى موقعك باستخدام OpenID.','ar',0,0,0),(546,'توفر وحدة الخيارات خانات اختيار، مربعات تحديد، وأشكال أخرى لوحدة الحقل. للمزيد من المعلومات يرجى مراجعة <a href=\"@field-helo\">صفحة المساعدة لوحدة الحقل</a>.','ar',0,0,0),(547,'يعرف ويدجات لقوائم الاختيار ومربعات الاختيار وأزرار الانتقاء للحقول النصية والعددية.','ar',0,0,0),(550,'إنشاء بدائل','ar',0,0,0),(552,'<em>member/jane-smith</em> هو بديل المسار الداخلي <em>user/123</em>','ar',0,0,0),(553,'<em>about-us/team</em> هو بديل المسار الداخلي <em>node/456</em>','ar',0,0,0),(554,'إدارة المسارات','ar',0,0,0),(555,'توفر وحدة المسار طريقة لبحث وعرض <a href=\"@aliases\">قائمة بجميع البدائل</a> قيد الاستخدام بموقعك. يمكن إضافة، تعديل وحذف البدائل من هذه القائمة.','ar',0,0,0),(556,'تمكن المستخدمين من إعادة تسمية المسارات.','ar',0,0,0),(557,'تمكن تقييم كود/قصاصات بي.إتش.بي المضمّنة.','ar',0,0,0),(558,'تسمح لموقعك بجمع التصويتات حول موضوعات مختلفة على شكل أسئلة متعددة الاختيارات.','ar',0,0,0),(562,'البحث عن المحتوى والمستخدمين','ar',0,0,0),(563,'المستخدمون الذين لديهم صلاحية <em>استخدام البحث</em> يمكنهم استخدام صندوق البحث و <a href=\"@search\">صفحة البحث</a>. المستخدمون الذين لديهم صلاحية <em>مشاهدة المحتوى المنشور</em> يمكنهم البحث عن المحتوى الذي يحتوي على كلمات معينة. المستخدمون الذين لديهم صلاحية <em>عرض الصفحات الشخصية للمستخدمين</em> يمكنهم البحث عن المستخدمين عن طريق كلمات معينة، والمستخدمون الذين لديهم صلاحية <em>إدارة المستخدمين</em> يمكنهم البحث عن المستخدمين عن طريق بريدهم الإلكتروني. بالإضافة إلى ذلك، المستخدمون الذين لديهم صلاحية <em>استخدام البحث المتقدم</em> يمكنهم إيجاد المحتويات باستخدام أساليب البحث وفلترة أكثر تعقيداً بتحديد خيار <em>البحث المتقدم</em> على <a href=\"@search\">صفحة البحث</a>.','ar',0,0,0),(564,'فهرسة المتحوى بمجدول الأعمال (كرون)','ar',0,0,0),(565,'لتمكين البحث باستعمال الكلمات المفتاحية، يحتفظ محرك البحث بفهرس للكلمات الموجودة في المحتوى والحقول، إضافة إلى النص المضاف إلى المحتواك من طرف وحدات أخرى (كالتعليقات من وحدة التعليقات المدمجة في النواة ومصطلحات الفئات من وحدة التصنيفات المدمجة في النواة). لإنشاء وتحديث هذا الفهرس، يجب إعداد <a href=\"@cron\">مهمة صيانة من طرف مجدول الأعمال (cron)</a> إعدادا صحيحا. يمكن للمستخدمين ذوي صلاحية <em>إدارة البحث</em> تكوين إعدادات مجدول الأعمال (cron) على <a href=\"@searchsettings\">صفحة إعدادات البحث</a>.','ar',0,0,0),(566,'إعادة فهرسة المحتوى','ar',0,0,0),(567,'التغييرات في محتوى موقعك (إنشاء، تعديل أو حذف محتوى أو تعليقات) تضيف تلقائياً هذه العناصر لفهرستها أو إعادة فهرستها عند التشغيل التالي للدورية. عند تعليم عنصر ما لإعادة الفهرسة، المحتوى الأسبق يبقى في الفهرس إلى غاية تشغيل الدورية، بعدها يتم تعويضه بالمحتوى الجديد. خلافاً للعمليات المرتبطة بالمحتوى، فإن العمليات المرتبطة بهيكلية موقعك لا تؤثر على إعادة الفهرسة للمحتوى ذي الصلة. العمليات المرتبطة بالهيكلية والتي تؤثر على المحتوى هي مثلاً حذف أو تعديل الوسوم، تفعيل أو تعطيل الوحدات التي تضيف نص إلى المحتوى (الوسوم، التعليقات، والوحدات التي توفر الحقول) وتعديل الحقول أو إعدادات العرض الخاصة بأنواع المحتوى. إذا أجريت إحدى هذه العمليات وأردت التأكد من تحديث فهرس البحث لكي يعكس التغييرات، يمكنك تحديد كل المحتوى لإعادة الفهرسة بالنقر على زر \"إعادة فهرسة الموقع\" على <a href=\"@searchsettings\">صفحة إعدادات البحث</a>. إذا كان لديك الكثير من المحتويات على موقعك، فقد يتطلب ذلك تشغيل الدورية عدة مرات لإعادة فهرسة الموقع بأكمله.','ar',0,0,0),(568,'ضبط إعدادات البحث','ar',0,0,0),(570,'صندوق البحث','ar',0,0,0),(571,'وحدة البحث تتضمن <em>صندوق بحث</em> افتراضي, والذي يمكن تفعيله وضبطه من <a href=\"@blocks\">صفحة إدارة الصناديق</a>. الصندوق سيظهر فقط للمستخدمين الذي لديهم صلاحية <em>البحث ضمن المحتوى</em>.','ar',0,0,0),(572,'توسيع وحدة البحث','ar',0,0,0),(574,'تفعل البحث على مستوى الموقع كله.','ar',0,0,0),(576,'إدارة الاختصارات','ar',0,0,0),(578,'اختيار مجموعات الاختصارات','ar',0,0,0),(579,'يمكن للمستخدمين الذين لديهم صلاحية تغيير مجموعة الاختصارات اختيار مجموعة الاختصارات المراد استخدامها في تبويب الاختصارات على صفحتهم الشخصية.','ar',0,0,0),(580,'إضافة وحذف الاختصارات','ar',0,0,0),(582,'عرض الاختصارات','ar',0,0,0),(584,'يتيح للمستخدمين إدارة قوائم مطوّعة للروابط المقصرة.','ar',0,0,0),(585,'تحتفظ بسجلات الوصول لموقعك.','ar',0,0,0),(586,'تسجل أحداث النظام في سجل النظام.','ar',0,0,0),(587,'وحدة النظام هي أساس الموقع، فهي توفر وظائف أساسية قابلة للتوسع والتي سيتم استخدامها من طرف الوحدات الأخرى والثيمات. بعض الوحدات الأساسية لدروبال هي جزء من وحدة النظام أو هي من يقوم بالتحكم بها، وهذا يشمل نظام التخزين المؤقت، تمكين وتعطيل الوحدات والثيمات، تحضير وعرض صفحات الإدارة، إضافة إلى تطوين الإعدادات الرئيسية للموقع. عدد معين من العمليات الأساسية لنظام الصيانة هي أيضا جزء من وحدة النظام. للمزيد من المعلومات، يرجى مراجعة دليل <a href=\"@system\">وحدة النظام</a> على الإنترنت.','ar',0,0,0),(588,'إدارة الوحدات','ar',0,0,0),(590,'إدارة الثيمات','ar',0,0,0),(592,'إدارة ذاكرة التخزين المؤقت','ar',0,0,0),(594,'تشغيل صيانة النظام','ar',0,0,0),(596,'ضبط الإعدادات الأساسية للموقع','ar',0,0,0),(598,'ضبط الإجراءات','ar',0,0,0),(600,'تتعامل مع ضبط الموقع العام للإداريين.','ar',0,0,0),(601,'تسمح لك وحدة التصنيفات بتصنيف محتوى موقعك. لتصنيف المحتوى، يمكنك تعييم <em>معاجم</em>، والتي تحتوي على <em>مصطلحات</em> مرتبطة، ثم قم بربط المعاجم بأنواع المحتوى. للمزيد من المعلومات، يرجى مراجعة دليل <a href=\"@taxonomy\">وحدة التصنيفات</a> على الإنترنت.','ar',0,0,0),(602,'إنشاء معاجم','ar',0,0,0),(604,'<em>معجم</em>: موسيقا','ar',0,0,0),(605,'<em>مصطلح</em>: موسيقا الـJazz','ar',0,0,0),(606,'<em>مصطلح فرعي</em>:موسيقا الـSwing','ar',0,0,0),(607,'<em>مصطلح فرعي</em>: Fusion','ar',0,0,0),(608,'<em>مصطلح</em>: روك','ar',0,0,0),(609,'<em>مصطلح فرعي</em>: كاونتري روك','ar',0,0,0),(610,'<em>مصطلح فرعي</em>: هارد روك','ar',0,0,0),(612,'المصطلحات التي تكون في<em>معجم بتوسيم حر</em> يمكن بناؤها تدريجيا كلما أنشأت أو عدلت محتوى. هذا هو الحال غالبا في تطبيقات  المدونات أو إدارة الصور.','ar',0,0,0),(613,'ربط المعاجم إلى أنواع المحتوى.','ar',0,0,0),(615,'تصنيف المحتوى','ar',0,0,0),(617,'عرض