الوصف','ar',0,0,0),(3334,'العدد الأقصى للحروف المستخدمة في ملخص المحتوى.','ar',0,0,0),(3335,'وحدة المجمع عبارة عن منظم وقارئ أخبار يجمع ويعرض أحدث المحتويات من التلقيمات المستندة إلى ار.اس.اس، ار.دي.اف و أتوم المتوفرة على شبكة الإنترنت. آلاف المواقع (خصوصا مواقع الأخبار والمدونات) تقوم بنشر آخر عناوين أخبارها في تلقيمات، باستخدام عدد من الأشكال الأساسية المبنية على اكس.ام.ال. لمزيد من المعلومات، يرجى مراجعة <a href=\"@aggregator-module\">وحدة المجمع<> بالكتيب المتوفر على موقع دروبال.','ar',0,0,0),(3336,'عرض التلقيمات','ar',0,0,0),(3337,'تحتوي التلقيمات على المحتويات المنشورة، والتي يمكن فرزها في تصنيفات، حسب الموضوع بصفة عامة. بإمكان المستخدمين عرض محتوى التلقيمة <a href=\"@aggregator\">بالصفحة الرئيسية للمجمع</a>، أو <a href=\"@aggregator-sources\">حسب المصدر</a> (بصفة أساسية، عن طريق قارئ تلقيمات RSS). بالإمكان عرض أحدث المحتويات في تلقيمة أو تصنيف معينة في <a href=\"@admin-block\">صفحة إدارة الصناديق</a>.','ar',0,0,0),(3338,'إضافة، تحرير وحذف التلقيمات','ar',0,0,0),(3339,'بإمكان الإداريين إضافة، تحرير وحذف التلقيمات، واختيار الطريقة التي تتم بها عملية التحقق من التلقيمات للبحث عن العناصر المحدثة في <a href=\"@feededit\">صفحة إدارة مجمع التلقيمات</a>.','ar',0,0,0),(3340,'تضمين OPML','ar',0,0,0),(3341,'لكل التلقيمات يتاح <a href=\"@aggregator-opml\">ملف نظام OPML</a>. OPML عبارة عن ملف مبني على شكل XML يستخدم لتبادل المعلومات المنظمة مثلا كقائمة تلقيمات RSS بالإمكان أيضاً <a href=\"@import-opml\">جلب التلقيمات عن طريق ملف OPML</a>.','ar',0,0,0),(3342,'إعداد مجدول الأعمال (كرون)','ar',0,0,0),(3343,'يجب أن يكون <a href=\"@cron\">مجدول الأعمال (كرون)</a> معدا إعدادا صحيحا حتى يتم تحديث التلقيمات تلقائيا.','ar',0,0,0),(3344,'<acronym title=\"Outline Processor Markup Language\">OPML</acronym> هو شكل من أشكال XML ويستخدم لتبادل العديد من التلقيمات بين المجمعات. يمكن لملف OPML واحد أن يحتوي على مجموعة من التلقيمات. بإمكان دروبال تحليل هذا النوع من الملفات وجلب جميع التلقيمات دفعة واحدة، وذلك لتوفير مجهود إضافتها يدوياً. بإمكانك رفع ملف من جهازك أو إدخال مسار الملف ليقوم 