,'تمتلك صفحات كتاب صندوق إبحار افتراضيا خاصا بالكتاب. يحتوي صندوق الإبحار هذا على روابط تؤدي  إلى الصفحات السابقة والتالية وإلى المستوى الأعلى من الصفحة الحالية من بنية الكتاب. يمكن تفعيل هذا الصندوق من <a href=\'@admin-block\'>صفحة إدارة الصناديق</a>. حتى تظهر صفحات كتاب في صندوق الإبحار يجب إضافتها إلى هيكل كتاب .','ar',0,0,0),(3386,'بالإمكان التعاون في إنشاء الكتب، من خلال السماح للأعضاء بإضافة صفحات إلى الكتب الموجودة، وإضافة هذه الصفحات إلى جدول أو قائمة محتويات مخصصة.','ar',0,0,0),(3387,'طباعة الكتب','ar',0,0,0),(3388,'يمكن للمستخدمين ذوي صلاحية <em>عرض نسخة للطباعة من الكُتب</em> تحديد رابط <em>نسخة للطباعة</em> الموجود أسفل كل صفحة كتاب لتكوين نسخة قابله للطباعة من الصفحة وكل أقسامها الفرعية.','ar',0,0,0),(3389,'توفر الوحدة Book وسائل لتنظيم مجموعة من صفحات المحتوى المرتبطة والتي يسمّى مجموعها كتابا. عند عرضه، يُظهر المحتوى تلقائيا روابط لصفحات الكتاب المجاورة، موفرا بذلك نظام تصفح بسيط لإنشاء ومراجعة محتوى منظّم.','ar',0,0,0),(3390,'تمكنك ميزة الهيكلة من إدراج صفحات في <a href=\"@book\">هرم الكتاب</a> وكذا نقلها داخل الهرم أو <a href=\"@book-admin\">إعادة ترتيب الكتاب بأكمله</a>.','ar',0,0,0),(3391,'إنشاء كتب جديدة','ar',0,0,0),(3392,'إضافة محتوى و صفحات فرعية للكتب','ar',0,0,0),(3393,'عرض نسخة للطباعة من الكتب','ar',0,0,0),(3394,'عرض صفحة الكتاب وكل صفحاتها الفرعية في مستند واحد من أجل تسهيل الطباعة. من الممكن ان يؤدي الى انخفاض الأداء.','ar',0,0,0),(3395,'لدى <em>الكتب</em> تصفح هرمي مدمج. استعمله للكُتيبات أو الدروس.','ar',0,0,0),(3396,'مكتبة جي.دي في بي.إتش.بي مفعلة، لكن تم تجميعه بدون دعم بي.إن.جي. من فضلك راجع <a href=\"@url\">توثيق بي.إتش.بي للصور</a> من أجل معلومات عن كيفية تصحيح هذا الأمر.','ar',0,0,0),(3397,'مكتبة GB الخاصة بال PHP مفقودة أو قديمة. راجع <a href=\"@url\">الوثائق الخاصة بالصور في PHP</a> لمعرفة كيفية تصحيح هذا الأمر.','ar',0,0,0),(3398,'من فضلك اختر تعليقاً أو أكثر لتطبيق التحديثات عليهم.','ar',0,0,0),(3399,'يبدو أنه لا توجد أي تعليقات للحذف أو أن التعليقات التي اخترتها قد حذفها إداري آخر.','ar',0,0,0),(3400,'تم حذف @count تعليق.','