رف OpenID الخاص بهم، ربط هوية أو عدة هويات OpenID بحسابهم، وتسجيل الدخول باستخدام معرف OpenID. هذا يخفف من عناء التسجيل، ويمنح المستخدمين المزيد من الراحة والأمن. نظراً إلى أن نظام هوية OpenID لا تضمن صحة حساب المستخدم، فإن التحقق من البريد الإلكتروني يبقى ضرورياً. أثناء تسجيل الدخول، يظهر للمستخدمين خيار لإدخال عنوان رابط معرف OpenID والذي يبدو على الشكل: <em>mon-nom.openidprovider.com</em>. يقوم الموقع بالاتصال بسيرفر OpenID، ويطلب التحقق من هوية المستخدم. إذا كان المستخدم مسجل الدخول مسبقاً بخادم OpenID الخاص به، يقوم الخادم بالرد على الموقع، والمصادقة على المستخدم. أما إذا لم يكن مسجل الدخول، فسيقوم خادم OpenID بطلب كلمة مرور المستخدم. في كل الحالات، الموقع لا يسجل كلمة مرور معرف OpenID الخاصة بالمستخدم.','ar',0,0,0),(3832,'بعد التحقق من صحة بريدك الإلكتروني، يمكنك تسجيل الدخول باستخدام هوية OpenID.','ar',0,0,0),(3833,'عذراً، هذه ليست هوية OpenID صحيحة. تأكد من إدخال معرف الهوية بشكل صحيح.','ar',0,0,0),(3834,'أكمل التسجيل بملأ النموذج أدناه. إذا كان لديك حساب فيمكنك <a href=\"@login\">تسجيل الدخول</a> الآن وإضافة معرف OpenID الخاص بك من صفحتك الشخصية.','ar',0,0,0),(3835,'حوار @title','ar',0,0,0),(3836,'البديل يعين مسار مختلف لمسار رابط موجود. مثل البديل\'حول-الموقع\' لمسار الرابط \'node/1\'. يمكن لمسار رابط أن يكون له عدة بدائل.','ar',0,0,0),(3837,'إدارة بدائل المسارات','ar',0,0,0),(3838,'إنشاء وتحرير بدائل المسارات','ar',0,0,0),(3839,'البديل مستخدم مسبقاً.','ar',0,0,0),(3840,'تمكين PHP في الحقول النصية','ar',0,0,0),(3841,'استخدام PHP للإعدادات','ar',0,0,0),(3842,'تم تعطيل وحدة PHP. برجاء الانتباه إلى أن أي محتوى موجود الآن و يحتوي على كود PHP سوف يظهر الكود كنص عادي. قد يسبب هذا خطورة على أمن الموقع و يقوم بعرض بعض المعلومات الحساسة إذا ما تم استخدامها في كود PHP.','ar',0,0,0),(3843,'يمكن استخدام وحدة الاستبيان لإنشاء استبيانات أو أسئلة بسيطة تعرض خيارات للتصويت. الاستبيان هو طريقة جيدة لتلقي آراء الزوار والمستخدمين. للمزيد من المعلومات، يرجى مراجعة دليل <a href=\"@poll\">وحدة الاستطلاع</a>.','ar',0,0,0),(3844,'إنشاء استبيان','ar',0,0,0),(3845,'بإمكان المستخدمين إنشاء استبيان بالنقر فوق الاستبيان في صفحة <a href=\"@add-content\">إضافة محتوى جديد</a>، ثم كتابة سؤال، والأجوبة المحتملة وتعيين القيمة المبدئية لعدد اﻷصوات. كما يمكن أيضاً تحديد الحالة (مغلق أو مفتوح) والمدة (الفترة التي يبقى فيها الاستطلاع مفتوح للتصويت).','ar',0,0,0),(3846,'عرض الاستبيانات','ar',0,0,0),(3847,'بإمكانك زيارة صفحة <a href=\"@poll\">الاستبيانات</a> لعرض جميع الاستبيانات الحالية، ويمكنك أيضاً تفعيل صندوق <em>أحدث  الاستبيانات</em> على صفحة <a href=\"@blocks\">إدارة الصناديق</a>. وللمشاركة في استبيان معين أو عرض نتائجه، انقر على ذلك الاستبيان.','ar',0,0,0),(3848,'المشاركة في الاستبيانات','ar',0,0,0),(3849,'إلغاء أو تعديل تصويته على الاستبيانات','ar',0,0,0),(3850,'تم إلغاء تصويتك.','ar',0,0,0),(3851,'لتفعيل تصفح هذا الحقل حسب القيمة، أدخل عنواناً لصفحة النتائج. يتم تعويض كلمة <code>%value</code> بالقيمة المناسبة. مثال على عنوان الصفحة \"المستخدمون الذين لونهم المفضل هو %value\". وهذه الميزة لا تستخدم إلا للحقول العامة.','ar',0,0,0),(3852,'لتفعيل تصفح هذا الحقل حسب القيمة، أدخل عنواناً لصفحة النتائج. مثال على عنوان الصفحة \"الأعضاء الذين لديهم عمل\". وهذه الميزة لا تستخدم إلا للحقول العامة.','ar',0,0,0),(3853,'تسمح وحدة الملف الشخصي لإداريي الموقع بتعريف حقول مخصصة (كالبلد، الاسم، اللقب والسن) لملفات المستخدمين، والتي سيتم عرضها لاحقاً في <a href=\"@user\">الصفحة الشخصية</a>. مما يسمح لمستخدمي الموقع بتبادل المزيد من المعلومات المتعلقة بهم، ويمكن أن يساعد المواقع الاجتماعية على تنظيم المستخدمين حسب معلومات معينة. للمزيد يرجى مراجعة صفحة الدليل حول <a href=\"@profile\">وحدة الملف الشخصي</a>.','ar',0,0,0),(3854,'إضافة حقول إلى الملف الافتراضي','ar',0,0,0),(3855,'لتوفير إمكانية إدخال معلومات إضافية للمستخدمين حول أنفسهم، تسمح وحدة Profile بإضافة حقول إضافية للملف الشخصي المبدئي للمستخدم. أمثلة عن الإضافات الكلاسيكية: <em>العنوان</em>، <em>المؤسسة</em>، <em>السن</em> أو <em>الهوايات</em>.','ar',0,0,0),(3856,'صفحات معلومات المستخدم','ar',0,0,0),(3857,'تسمح وحدة الملف الشخصي بتفعيل روابط لعرض المزيد من المعلومات حول مستخدمي الموقع. يمكنك عرض <a href=\"@profile\">صفحة بقائمة المستخدمين</a>، وصفحات معينة بالنقر على الحقول التي توفر رابط من أي ملف مستخدم. على سبيل المثال، قائمة <a href=\"@profile-country\">المستخدمين القاطنين بكندا</a> على موقع دروبال تعرض جميع المستخدمين الذين أدخلوا <em>كندا</em> في حقل <em>البلد</em> على ملفهم الشخصي.','ar',0,0,0),(3858,'صندوق معلومات المؤلف','ar',0,0,0),(3859,'هذه الصفحة تسرد الحقول المخصصة الموجودة التي يمكن عرضها على صفحة <em>حسابي</em> لمستخدم ما. لتوفير هيكلية معينة، يمكن وضع الحقول المتشابهة أو المشتركة في فئة ما. لإضافة فئة جديدة (أو تعديل فئة موجودة)، قم بتعديل حقل من ملف المستخدم و غير اسم الفئة.','ar',0,0,0),(3860,'تم تغيير وحدات البحث المفعلة.','ar',0,0,0),(3861,'البحث في %type عن %key.','ar',0,0,0),(3862,'<ul>\r\n<li>تحقق من كتابة الكلمات بشكل صحيح.</li>\r\n<li>احذف علامات الاقتباس حول العبارة للبحث عن كل كلمة على انفراد <em>مرأب السيارة</em> غالباً تعطي نتائج أكثر من <em>&quot;مرأب السيارة&quot;</em>.</li>\r\n<li>حاول توسيع نطاق البحث باستخدام <em>OR</em>. <em>مرأب OR سيارة</em> غالباً تعطي نتائج أكثر من <em>مرأب سيارة</em>.</li>\r\n</ul>','ar',0,0,0),(3863,'إدارة البحث','ar',0,0,0),(3864,'استخدام البحث','ar',0,0,0),(3865,'استخدام البحث المتقدم','ar',0,0,0),(3866,'اختر مجموعة اختصارات لاستخدامها','ar',0,0,0),(3867,'اختر مجموعة اختصارات لهذا المستخدم','ar',0,0,0),(3868,'أنت تستخدم الآن مجموعة الاختصارات الجديدة %set_name. يمكنك تغييرها من خلال هذه الصفحة أو <a href=\"@switch-url\">التغيير لمجموعة مختلفة</a>.','ar',0,0,0),(3869,'%user يستخدم الآن مجموعة الاختصارات الجديدة %set_name. يمكنك تغييرها من هذه الصفحة.','ar',0,0,0),(3870,'أنت تستخدم الآن مجموعة الاختصارات %set_name.','ar',0,0,0),(3871,'%user يستخدم الآن مجموعة الاختصارات %set_name.','ar',0,0,0),(3872,'تغيير المجموعة','ar',0,0,0),(3873,'تم تحديث مجموعة الاختصارات.','ar',0,0,0),(3874,'إضافة اختصار جديد','ar',0,0,0),(3875,'تغيير @shortcut','ar',0,0,0),(3876,'اسم الاختصار.','ar',0,0,0),(3877,'مسار الاختصار.','ar',0,0,0),(3878,'يجب أن يؤدي الرابط إلى مسار صحيح على الموقع.','ar',0,0,0),(3879,'تم تحديث الاختصار %link.','a