كنك تسجيل الدخول من [site:login-url] في المستقبل باستعمال:\r\n\r\nاسم المستخدم: [user:name]\r\nكلمة المرور: كلمة مرورك\r\n\r\n-- فريق [site:name]','ar',0,0,0),(4455,'[user:name]،\r\n\r\nأنشأ مدير في موقع [site:name] حسابا لك. يمكنك الآن تسجيل الدخول بالنقر على هذا الرابط أو نسخه ثم لصقه في متصفحك:\r\n\r\n[user:one-time-login-url]\r\n\r\nيمكن استعمال هذا الرابط مرة واحدة فقط لتسجيل الدخول وسيقودك إلى صفحة يمكنك فيها تحديد كلمة مرورك.\r\n\r\nبعد تحديد كلمة مرورك، يمكنك تسجيل الدخول من [site:login-url] في المرات القادمة باستعمال:\r\n\r\nاسم المستخدم: [user:name]\r\nكلمة المرور: كلمة مرورك\r\n\r\n-- إدارة موقع [site:name]','ar',0,0,0),(4456,'[user:name]،\r\n\r\nتم تقديم طلب إعادة تحديد كلمة مرور لحسابك في [site:name]\r\n\r\nيمكنك الآن تسجيل الدخول بالنقر على هذا الرابط أو نسخه ثم لصقه في متصفحك:\r\n\r\n[user:one-time-login-url]\r\n\r\nيمكن استعمال هذا الرابط مرة واحدة فقط لتسجيل الدخول وسيقودك إلى صفحة يمكنك فيها تحديد كلمة مرورك. تنتهي صلاحيته بعد يوم ولن يحصل شيئ إذا لم يُستعمل.\r\n\r\n-- فريق [site:name]','ar',0,0,0),(4457,'لا يوجد (الصورة الأصلية)','ar',0,0,0),(4458,'عنوان رابط صفحة تعديل الحساب.','ar',0,0,0),(4459,'عرض التعليقات','ar',0,0,0),(4460,'اسم الحقل الجديد','ar',0,0,0),(4461,'خطأ أثناء فتح المأخذ @socket','ar',0,0,0),(4462,'دالة رد النداء (callback) غير موجودة','ar',0,0,0),(4463,'callback @callback غير موجود : %q.','ar',0,0,0),(4464,'تعذر نسخ الملف المحدد %file لأن الوجهة غير صحيحة. المزيد من المعلومات متوفرة في سجل النظام.','ar',0,0,0),(4465,'تعذر نسخ الملف المحدد %file لأن دليل الوجهة غير معد بشكل صحيح.قد يكون هذا بسبب مشكل في الأذونات على الملف أو الدليل. المزيد من المعلومات متوفرة في سجل النظام.','ar',0,0,0),(4466,'تعذر نسخ الملف %file لأنه يوجد ملف بنفس هذا الاسم في دليل الوجهة.','ar',0,0,0),(4467,'تعذر نقل الملف المحدد %file لأن الوجهة غير صحيحة. المزيد من المعلومات متوفرة في سجل النظام.','ar',0,0,0),(4468,'تعذر حذف الملف المحدد %file، لأنه ليس URI صحيح. المزيد من المعلومات متوفرة في سجل النظام.','ar',0,0,0),(4469,'تعذر حفظ البيانات لأن الوجهة غير صح